import React from 'react';
import './app.css';

// import Header from '../header';
// import Technologies from '../technolodies';
// import Footer from '..footer';



const App = () => {
  return (
    <div className='app-wrapper'> 
      <header className='header'> 
        <img src=''/>
      </header>

      <nav className='nav'>
      <div>
        <a>Profile</a></div>
        <div>
        <a>Messages</a></div>
        <div>
        <a>News</a></div>
        <div>
        <a>Music</a></div>
        <div>
        <a>Settings</a></div>
      </nav>

      <div className='content'>
          <div>
              <img src='https://i.pinimg.com/564x/0a/9b/0f/0a9b0f4466e573f7b131658e79e606eb.jpg'></img>
          </div>
          <div>
              ava + description
          </div>
          <div>
              My posts
              <div>

              </div>
          </div>
      </div>

    </div>
  );
}

export default App;
